// SPDX-License-Identifier: AGPL-3.0-only
pragma solidity >=0.8.7;

import {ERC20} from "./ERC20.sol";
import {ERC4626} from "./ERC4626.sol";

contract SquiddyCore is ERC4626 {

    address internal _manager;
    uint256 public beforeWithdrawHookCalledCounter = 0;
    uint256 public afterDepositHookCalledCounter = 0;
    uint256 internal immutable BASE_UNIT;
    ERC20 public immutable UNDERLYING;
    uint256 internal constant MAX_WITHDRAWAL_STACK_SIZE = 32;

//*******************************EVENTS*******************************************//

event StrategyAInitilized(
        address indexed searcher,
        address indexed vault,
        uint256 value,
        uint256 duration
    );

event StrategyBInitilized(
        address indexed stakePoolContract,
        address indexed vault,
        uint256 value,
        uint256 duration
    );  
event HarvestStrategyA(
        address indexed vault,
        uint256 profitOverLoss
    );
event HarvestStrategyB(
        address indexed vault,
        uint256 profitOverLoss
    ); 

event OwnershipTransferred(
        address indexed previousManager,
        address indexed newManager
    );           

//********************************************************************************//
//*******************************MODIFIERS****************************************//

modifier onlyManager() {
        require(manager() == msg.sender, "Ownable: caller is not the manager");
        _;
    }

//******************************************************************************//


    constructor(
        ERC20 _underlying,
        string memory _name,
        string memory _symbol,
        uint8 _decimals
    ) ERC4626(_underlying, _name, _symbol, _decimals) {
        UNDERLYING = _underlying;

        BASE_UNIT = 10**decimals;

        // Prevent minting of sVTokens until
        // the initialize function is called.
        totalSupply = type(uint256).max;
    }



    function totalAssets() public view override returns (uint256) {
        return asset.balanceOf(address(this));
    }

    function beforeWithdraw(uint256, uint256) internal override {
        beforeWithdrawHookCalledCounter++;
    }

    function afterDeposit(uint256, uint256) internal override {
        afterDepositHookCalledCounter++;
    }

    function strategyACall(address _searcher, uint256 _gas,  uint160 _duration ) private  {

       emit StrategyAInitilized(_searcher, address(this), _gas, _duration);
        return;
    }


/************************MANAGER***********************************/
function manager() public view virtual returns (address) {
        return _manager;
    }
    /**
     * @dev Leaves the contract without manager. It will not be possible to call
     * `onlyManager` functions anymore. Can only be called by the current manager.
     *
     * NOTE: Renouncing ownership will leave the contract without an manager,
     * thereby removing any functionality that is only available to the manager.
     */
    function renounceOwnership() public virtual onlyManager {
        emit OwnershipTransferred(_manager, address(0));
        _manager = address(0);
    }

    /**
     * @dev Transfers ownership of the contract to a new account (`newOwner`).
     * Can only be called by the current manager.
     */
    function transferOwnership(address newOwner) public virtual onlyManager {
        require(
            newOwner != address(0),
            "Ownable: new manager is the zero address"
        );
        emit OwnershipTransferred(_manager, newOwner);
        _manager = newOwner;
    }


 /***********************FEE CONFIGURATION/CLAIM***************************/
    /// @notice The percentage of profit recognized each harvest to reserve as fees.
    /// @dev A fixed point number where 1e18 represents 100% and 0 represents 0%.
    uint256 public feePercent;

    /// @notice Emitted when the fee percentage is updated.
    /// @param user The authorized user who triggered the update.
    /// @param newFeePercent The new fee percentage.
    event FeePercentUpdated(address indexed user, uint256 newFeePercent);

    /// @notice Sets a new fee percentage.
    /// @param newFeePercent The new fee percentage.
    function setFeePercent(uint256 newFeePercent) external onlyManager {
        // A fee percentage over 100% doesn't make sense.
        require(newFeePercent <= 1e18, "FEE_TOO_HIGH");

        // Update the fee percentage.
        feePercent = newFeePercent;

        emit FeePercentUpdated(msg.sender, newFeePercent);
    }

     /// @notice Emitted after fees are claimed.
    /// @param user The authorized user who claimed the fees.
    /// @param rvTokenAmount The amount of rvTokens that were claimed.
    event FeesClaimed(address indexed user, uint256 rvTokenAmount);

    /// @notice Claims fees accrued from harvests.
    /// @param rvTokenAmount The amount of rvTokens to claim.
    /// @dev Accrued fees are measured as rvTokens held by the Vault.
    function claimFees(uint256 rvTokenAmount) external onlyManager {
        emit FeesClaimed(msg.sender, rvTokenAmount);

        // Transfer the provided amount of rvTokens to the caller.
        ERC20(this).transfer(msg.sender, rvTokenAmount);
    }

    /***********************************************************/


}

